column13:
Compounds of formula (I), and salts and prodrugs thereof

 wherein 
   Q is the residue of an optionally substituted azabicyclic ring system; 
   X represents oxa or thia; 
   Y represents H or hydroxy; 
   R¹ and R² independently represent phenyl or thienyl, either of which groups may be optionally substituted by halo or trifluoromethyl; 
   R³, R⁴ and R⁵ independently represent H, C₁₋₆ alkyl, C₂₋₆ alkenyl, C₂₋₆ alkynyl, halo, cyano, nitro, trifluoromethyl, trimethylsilyl, -OR a , SCH₃, SOCH₃, SO₂CH₃, -NR a R b , -NR a COR b , -NR a CO₂R b , -CO₂R a  or -CONR a R b ; and 
   R a  and R b  independently represent H, C₁₋₆ alkyl, phenyl or trifluoromethyl, 
   are tachykinin antagonists. They and compositions thereof are therefore useful in therapy.

An apparatus for forming at least one channel on or in the ground is characterised in that it includes: 
a frame (12) movable in a forwards direction over the ground to be channelled; 
at least one ground engaging means comprising ground opening means (1,6) for opening the ground and forming the channel and ground closing means (2) for subsequently closing the channel when the frame is moved forwardly with the ground engaging means engaged with the ground; 
resilient connecting means (3) trailing from the frame and connecting the ground engaging means thereto, the construction and arrangement of the connecting means being such as to prevent any substantial lateral movement while allowing substantially vertical movement of the ground engaging means relative to the frame, whereby, in use of the apparatus, the connecting means biases the ground engaging means into engagement with the ground but is capable of being deflected upwardly should it strike an obstacle on or in the ground to clear said obstacle.
